#include <bits/stdc++.h>
#include <ext/pb_ds/assoc_container.hpp>

#define l first
#define r second

#define int int64_t
#define double long double

using namespace std;
using namespace __gnu_pbds;

std::mt19937_64 rnd(std::chrono::steady_clock::now().time_since_epoch().count());
std::uniform_real_distribution<double> rnd_double(0, 1);

int nextInt(int r) {  // [0; R)
    return rnd() % r;
}

int nextInt(int l, int r) {  // [L; R)
    return l + rnd() % (r - l);
}

double nextDouble() {  // [0; 1]
    return rnd_double(rnd);
}

double nextDouble(double r) {  // [0; R]
    return r * nextDouble();
}

double nextDouble(double l, double r) {  // [L; R]
    return l + (r - l) * nextDouble();
}

template <typename T>
using Orset = __gnu_pbds::tree<T, __gnu_pbds::null_type, std::less<T>, __gnu_pbds::rb_tree_tag,
        __gnu_pbds::tree_order_statistics_node_update>;

template <typename T>
using Ormultiset =
        __gnu_pbds::tree<T, __gnu_pbds::null_type, std::less_equal<T>, __gnu_pbds::rb_tree_tag,
                __gnu_pbds::tree_order_statistics_node_update>;

constexpr int N = 1e6 + 1;

array<char, N> L;
array<int, N> tin, tout, answers;
array<vector<int>, N> graph;

inline void addEdge(int v, int u) {
    graph[v].push_back(u);
    graph[u].push_back(v);
}

void getTree(vector<int> &euler, int l, int r) {
    int v = euler[l];
    int cur_idx = l + 1;

    while (cur_idx < r) {
        int u = euler[cur_idx];
        addEdge(v, u);
        getTree(euler, tin[u], tout[u]);
        cur_idx = tout[u] + 1;
    }
}

void dfs(int v = 0, int p = -1, int len = 1) {
    for (auto u : graph[v]) {
        if (u != p) {
            if (L[v] == L[u] && v != 0) {
                dfs(u, v, len + 1);
            } else {
                if (v != 0) {
                    answers[u] = len;
                }
                dfs(u, v);
            }
        }
    }
}

void runSolve() {
    int n;
    cin >> n;
    for (int i = 1; i <= n; ++i) {
        cin >> L[i];
    }

    vector<int> euler(2 * (n + 1));
    for (auto &i : euler) {
        cin >> i;
    }

    for (int i = 1; i <= 2 * n; ++i) {
        int v = euler[i];
        if (!tin[v]) {
            tin[v] = i;
        } else {
            tout[v] = i;
        }
    }

    getTree(euler, 0, 2 * n + 1);
    dfs();

    for (int i = 1; i <= n; i++) {
        cout << answers[i] << ' ';
    }
}

int32_t main() {
    ios::sync_with_stdio(false);
    cin.tie(nullptr);
    int t = 1;
//    cin >> t;
    while (t--) {
        runSolve();
    }
}

