            {
                continue;
            }
            for(int j=arr.size()-1 ; j>=i+3 ; j--)
            {
                if(j<arr.size()-1 && arr[j]==arr[j+1])
                {
                    continue;
                }
                int low =i+1;
                int high=j-1;
                while(low<high)
                {
                    
                    int sum=arr[i]+arr[j]+arr[low]+arr[high];
                    if(sum==k)
