#include <cstring>
#include <iostream>
//#include <bits/stdc++.h>
using namespace std;






int main()
{
    int n;
    cin>>n;
    vector < pair<int,int> > v;
    int x,y;
    for(int i=0;i<n;i++)
    {
        cin>>x>>y;
        v.push_back(make_pair(x,y));
    }
    vector < pair<int, double> > g[n];




   vector<bool> visited(n,false);
    vector<double> dis(n,-2e9);
    for(int i=0;i<n;i++)
    {
        for(int j=0;j<n;j++)
        {
            double d=sqrt(((v[j].first-v[i].first) * (v[j].first-v[i].first))+((v[j].second-v[i].second)*(v[j].second-v[i].second)));
            if(d<=10)
                g[i].push_back(make_pair(j,-d));
        }
    }
    dis[0]=0;
    priority_queue<pair<double, int> > pq;
    pq.push(make_pair(0,0));




   while(!pq.empty())
    {
        pair<double, int> c=pq.top();

        pq.pop();


       if(visited[c.second])
        {
            continue;
        }
        visited[c.second]=true;
        for(int i=0;i<g[c.second].size();i++)
        {
            int s=g[c.second][i].first;
            double t=g[c.second][i].second;




           if(!visited[s] && c.first+t>dis[s])
            {
                pq.push(make_pair(c.first+t, s));
                dis[s]=c.first+t;
            }
        }
    }
    cout<<-dis[n-1]<<endl;
    return 0;
}

#include<bits/stdc++.h>

using namespace std;

int main(){
    int n;
    cin >> n;
    int arr[n];

    for(int i=0; i<n; i++){
        cin >> arr[i];
    }

    int j=0;
    int gym=0;
    int contest=0;
    int rest=0;

    while(j<n){
        switch(arr[j]){
        case 0:
            rest++;
            gym=0;
            contest=0;
            break;
        case 1:
            if(contest!=0){
                rest++;
                gym=0;
                contest=0;
            }else{
                contest++;
                gym=0;
            }
            break;
        case 2:
            if(gym!=0){
                rest++;
                gym=0;
                contest=0;
            }else{
                gym++;
                contest=0;
            }
            break;
        case 3:
            int three=0;
            for(int k=j; arr[k]==3; k++){
                if(arr[k]==3) three++;
            }
            if(contest!=0 && gym==0){
                gym++;
                contest=0;
            }else if(gym!=0 && contest==0){
                contest++;
                gym=0;
            }else if(gym==0 && contest==0){
                if(arr[j+1]==1){
                    gym++;
                    contest=0;
                }else if(arr[j+1]==2){
                    contest++;
                    gym=0;
                }else if(arr[j+1]==0){
                    contest++;
                    gym=0;
                }else if(arr[j+1]==3){
                    if(arr[j+three]==1){
                        gym++;
                        contest=0;
                    }else if(arr[j+three]==2){
                        contest++;
                        gym=0;
                    }else{
                        contest++;
                        gym=0;
                    }
                }
                j=j+three;
                continue;
            }else{
                rest++;
                contest=0;
                gym=0;
            }

        }
        /*cout << contest << "\n";
        cout << gym << "\n";
        cout << rest << "\n";*/
        j++;
    }

    cout << rest << "\n";

}
